import React, { useState } from 'react';

const navbar = () => {
  // const [showmenu, setShowmenu] = useState(false);
  return (
    <div>
      <nav className="nav">
        <div className="menu">
          <ul>
            <li>Home</li>
            <li>About</li>
            <li>Resume</li>
            <li>Portfolio</li>
            <li>Contact</li>
          </ul>
        </div>
        <h1>MENU</h1>
      </nav>
    </div>
  );
};

export default navbar;
